60年代のダイナーを彷彿とさせるカラーの<br>食器シリーズです。<br>街のダイナーで使われているような、<br>ぽってりとした厚みのある形が魅力。<br>ヴィンテージ間溢れるアート、ロゴデザインは、<br>古き良きアメリカを蘇らせます。<br><br>
【サイズ】幅11cm×高さ9cm×奥行7.5cm<br><br>

【Disneyzone】<br>
